import React, { useRef, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { BrowserMultiFormatReader } from '@zxing/library';
import './Portfolios.css';

const Portfolios = () => {
  const [isScannerOpen, setIsScannerOpen] = useState(false);
  const [result, setResult] = useState('');
  const videoRef = useRef(null);
  const codeReader = useRef(null);
  const navigate = useNavigate();

  const handlePortfolioClick = () => {
    navigate('/Portfolioslist');
  };

  const startScanning = () => {
    if (videoRef.current && !codeReader.current) {
      codeReader.current = new BrowserMultiFormatReader();
      codeReader.current
        .decodeFromVideoDevice(null, videoRef.current, (result, error) => {
          if (result) {
            setResult(result.text);
            setIsScannerOpen(false);
            codeReader.current.reset();
          }
          if (error) {
            console.error(error);
          }
        })
        .catch((err) => console.error(err));
    }
  };

  const stopScanning = () => {
    if (codeReader.current) {
      codeReader.current.reset();
      codeReader.current = null;
    }
  };

  return (
    <div className="main_menu_wrapper container">
      <div className="text-center mb-4">
        <h5 className="black-text">ARJUN'S PORTFOLIOS</h5>
      </div>
      <div className="portfoilios">
        <div className="text-center mt-4">
          <div
            className="qr-code-box p-3 mb-4"
            onClick={() => {
              setIsScannerOpen(true);
              startScanning();
            }}
          >
            <div>
              <img src="/scanner.png" alt="Scan QR Code" className="img-fluid" />
            </div>
            <div className="text-center">
              <h3>Scan QR Code</h3>
            </div>
          </div>
        </div>
        {isScannerOpen && (
          <div className="qr-scanner-overlay">
            <video ref={videoRef} style={{ width: '100%' }} />
            <button onClick={stopScanning}>Stop Scanning</button>
          </div>
        )}
       <div className="row">
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 1" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 1</h4>
              </div>
              <div className="mt-2">
                <small>6 items</small>
              </div>
            </div>
          </div>
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 2" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 2</h4>
              </div>
              <div className="mt-2">
                <small>2 items</small>
              </div>
            </div>
          </div>
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 3" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 3</h4>
              </div>
              <div className="mt-2">
                <small>3 items</small>
              </div>
            </div>
          </div>
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 4" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 4</h4>
              </div>
              <div className="mt-2">
                <small>9 items</small>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Portfolios;
